webpackJsonp([0x5e6c63e88f5c],{375:function(a,t){a.exports={data:{markdownRemark:{html:'<h3 id="deep-learning-on-kaggle-sea-lion-data-set"><a href="#deep-learning-on-kaggle-sea-lion-data-set" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Deep Learning on Kaggle Sea Lion Data Set</h3>\n<p>Together with a friend I participated in the <a href="https://www.kaggle.com/c/noaa-fisheries-steller-sea-lion-population-count">NOAA Fisheries Steller Sea Lion Population Count</a> and was ranked 37th with our solution. The task was to count Sealion Lions from Drone imagery. We used a combination of pretrained Inception-v4, RNNs and Countception to count the sealion from the images. Currently we are exploring other Data Sets which could benefit from our approach.  </p>\n<div class="md-grid">\n  <div class= "md-cell--6">\n<p>Sample Data:\n\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 256px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Sample Data"\n        title=""\n        src="/portfolio/static/b6a0c3806a38380cab7b906a5bb90732-f578f.png"\n        srcset="/portfolio/static/b6a0c3806a38380cab7b906a5bb90732-727c0.png 64w,\n/portfolio/static/b6a0c3806a38380cab7b906a5bb90732-9eccb.png 128w,\n/portfolio/static/b6a0c3806a38380cab7b906a5bb90732-f578f.png 256w"\n        sizes="(max-width: 256px) 100vw, 256px"\n      />\n    </span>\n  </span>\n  </p>\n  </div>\n<div class= "md-cell--6">\n<p>Architecture:\n\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 256px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Architecture"\n        title=""\n        src="/portfolio/static/5fa6c03e57608660010023f20ff5f35b-f578f.png"\n        srcset="/portfolio/static/5fa6c03e57608660010023f20ff5f35b-727c0.png 64w,\n/portfolio/static/5fa6c03e57608660010023f20ff5f35b-9eccb.png 128w,\n/portfolio/static/5fa6c03e57608660010023f20ff5f35b-f578f.png 256w,\n/portfolio/static/5fa6c03e57608660010023f20ff5f35b-ba99f.png 384w,\n/portfolio/static/5fa6c03e57608660010023f20ff5f35b-7fbd7.png 512w,\n/portfolio/static/5fa6c03e57608660010023f20ff5f35b-0e8bc.png 768w,\n/portfolio/static/5fa6c03e57608660010023f20ff5f35b-5fff9.png 7320w"\n        sizes="(max-width: 256px) 100vw, 256px"\n      />\n    </span>\n  </span>\n  </p>\n  </div>\n</div>\n<div class="md-grid">\n  <div class= "md-cell--6">\n<p>Example Input(modified data):\n\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 256px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Example input"\n        title=""\n        src="/portfolio/static/d5158e8e6c87f751abad8468a3952986-f578f.png"\n        srcset="/portfolio/static/d5158e8e6c87f751abad8468a3952986-727c0.png 64w,\n/portfolio/static/d5158e8e6c87f751abad8468a3952986-9eccb.png 128w,\n/portfolio/static/d5158e8e6c87f751abad8468a3952986-f578f.png 256w,\n/portfolio/static/d5158e8e6c87f751abad8468a3952986-ba99f.png 384w,\n/portfolio/static/d5158e8e6c87f751abad8468a3952986-25328.png 388w"\n        sizes="(max-width: 256px) 100vw, 256px"\n      />\n    </span>\n  </span>\n      </p>\n  </div>\n<div class= "md-cell--6">\n<p>Example Output:\n\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 246px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Example output"\n        title=""\n        src="/portfolio/static/af75a7c86162dd5e94aae6765167e29a-7ef95.png"\n        srcset="/portfolio/static/af75a7c86162dd5e94aae6765167e29a-0bb26.png 64w,\n/portfolio/static/af75a7c86162dd5e94aae6765167e29a-9f11b.png 128w,\n/portfolio/static/af75a7c86162dd5e94aae6765167e29a-7ef95.png 246w"\n        sizes="(max-width: 246px) 100vw, 246px"\n      />\n    </span>\n  </span>\n      </p>\n  </div>\n</div>\n<h4 id="abstract"><a href="#abstract" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Abstract</h4>\n<p>We examined the practicability of counting Stellar Sea Lions from drone imagery using neural networks. Our solution is based on a variant of density map-based counting presented by [9] called Count-ception. Our primary change to Count-ception is, rather than preserving the resolution throughout the network, to use targets that have a lower resolution than the input. This was achieved by using a pre- trained Inception-v4 network as a feature extractor and fine- tuning it on the counting task. This change significantly reduced memory and computation costs. We also experimented with using RNNs for iterative image interpretation for the counting and with providing additional context as input to the network such that it can perceive of animals that are located beyond or right at the borders of the input image patches. Our solution won the 37th place in the Kaggle challenge “NOAA Fisheries Steller Sea Lion Population Count”.</p>\n<h4 id="tools"><a href="#tools" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Tools</h4>\n<p>Python 3, Numpy, Tensorflow, OpenCV, Pandas, ...</p>\n<h4 id="results"><a href="#results" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Results</h4>\n<table>\n<thead>\n<tr>\n<th>Model</th>\n<th align="center">Validation set RMSE</th>\n<th align="right">Private Leaderboard RMSE</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>our model, scale 1.0</td>\n<td align="center">8.40</td>\n<td align="right">24.07</td>\n</tr>\n<tr>\n<td>our model, scale 0.5</td>\n<td align="center">9.76</td>\n<td align="right">19.46</td>\n</tr>\n<tr>\n<td>winning solution</td>\n<td align="center">-</td>\n<td align="right">10.86</td>\n</tr>\n</tbody>\n</table>\n<hr>\n<h4 id="more-information"><a href="#more-information" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>More Information</h4>\n<ul>\n<li>visit the github repo: <a href="https://github.com/rdinse/sea-lion-counter">SeaLion-counter</a></li>\n<li>winning solution: <a href="https://www.kaggle.com/outrunner/use-keras-to-count-sea-lions/notebook">Kaggle notebook</a></li>\n</ul>',frontmatter:{date:"04/08/2017",path:"/sealioncounter",title:"Kaggle Challenge: SeaLion Counter",cover:"img/sealion0.png",tags:["programming","deep learning","machine learning"]}}},pathContext:{}}}});
